response.about:
Всем привет! Давайте знакомиться ;) 

Я Таня. Свадебный и семейный фотограф. Фотографией занимаюсь уже более 12 лет, профессионально почти 8.

Могу помочь с реализацией таких съёмок как: 
- свадебная; 
- семейная;
- фотосессия беременности;
- индивидуальная женская фотосъёмка; 
- контент съёмка;
- репортажная съёмка мероприятий (праздников, девичников и тп.).

Помимо фотографии в моей жизни много других интересов. Последние 2 года я активно занимаюсь изучением и внедрением в свою жизнь привычек, связанных с ментальным и физическим здоровьем. Очень интересен мир психологии и самоанализа. Кайфую от походов в тренажёрный зал и активно впитываю все, что касается ЗОЖ и нутрициологии. Периодически залипаю на просмотры модных показов и поиск информации на тему стиля. Кстати, даже имею некоторое образование в этом вопросе. Обожаю путешествия, выезды на природу, общение с интересными, близкими по духу людьми, эстетичные места и вкусную еду (если она к тому же полезная, так вообще кайф!).
